Drugged

Health-Medical Documentary hosted by Adam James, published by National Geographic in 2013 - English narration


Information
------------------------------

Drugged
This gritty, hard-hitting series offers drug addicts the chance to get clean by putting them through medical and psychological testing, and revealing the devastating effects that their drug use has had on both their minds and bodies.





2)  High on Cocaine 
Cocaine: a powerful and a destructive drug glamorized by models, rock stars and celebrities. We zoom inside the human body from the moment the substance enters our systems. With the guidance of doctors, we learn about the intense highs and painful lows of one of the most widely used stimulants in the U.S.



